\",\\\"title\\\":\\\"\\\",\\\"subtitle\\\":\\\"\\\",\\\"social_repeater\\\":\\\"undefined\\\",\\\"id\\\":\\\"customizer_repeater_56d7ea7f40a58\\\",\\\"shortcode\\\":\\\"undefined\\\"}]\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2019-07-11 14:17:32\"\n    },\n    \"hestia-pro::hestia_team_content\": {\n        \"value\": \"[{\\\"icon_value\\\":\\\"\\\",\\\"text\\\":\\\"\\\",\\\"link\\\":\\\"\\\",\\\"text2\\\":\\\"undefined\\\",\\\"image_url\\\":\\\"http://www.resortfarmvilla.com/wp-content/uploads/2019/07/CHILD-POOL-300x200.jpg\\\",\\\"title\\\":\\\"Swimming Pool\\\",\\\"subtitle\\\":\\\"Refreshing Chlorine Bathing Water Cleaned Regularly To Relieve Stress Of Work In Weekends.\\\",\\\"social_repeater\\\":\\\"\\\",\\\"id\\\":\\\"customizer_repeater_56d7ea7f40c56\\\",\\\"shortcode\\\":\\\"undefined\\\"},{\\\"icon_value\\\":\\\"\\\",\\\"text\\\":\\\"\\\",\\\"link\\\":\\\"\\\",\\\"text2\\\":\\\"undefined\\\",\\\"image_url\\\":\\\"http://www.resortfarmvilla.com/wp-content/uploads/2019/07/1H5A9339-300x200.jpg\\\",\\\"title\\\":\\\"Indoor Games\\\",\\\"subtitle\\\":\\\"Snooker, Carrom, Table Tennis and Many Other Indoor Games To Play With Family\\\",\\\"social_repeater\\\":\\\"\\\",\\\"id\\\":\\\"customizer_repeater_56d7ea7f40c66\\\",\\\"shortcode\\\":\\\"undefined\\\"},{\\\"icon_value\\\":\\\"\\\",\\\"text\\\":\\\"\\\",\\\"link\\\":\\\"\\\",\\\"text2\\\":\\\"undefined\\\",\\\"image_url\\\":\\\"http://www.resortfarmvilla.com/wp-content/uploads/2019/07/1H5A9350-300x200.jpg\\\",\\\"title\\\":\\\"Gymnesium\\\",\\\"subtitle\\\":\\\"Indoor Gymnasium For Exercise &amp; Healthy LifeStyle\\\",\\\"social_repeater\\\":\\\"\\\",\\\"id\\\":\\\"customizer_repeater_56d7ea7f40c76\\\",\\\"shortcode\\\":\\\"undefined\\\"},{\\\"icon_value\\\":\\\"\\\",\\\"text\\\":\\\"\\\",\\\"link\\\":\\\"\\\",\\\"text2\\\":\\\"undefined\\\",\\\"image_url\\\":\\\"http://www.resortfarmvilla.com/wp-content/uploads/2019/07/conference-1-300x200.jpg\\\",\\\"title\\\":\\\"Conference Hall\\\",\\\"subtitle\\\":\\\"Dedicated Conference Hall For Business Meeting &amp; Professional Gatherings.\\\",\\\"social_repeater\\\":\\\"\\\",\\\"id\\\":\\\"customizer_repeater_56d7ea7f40c86\\\",\\\"shortcode\\\":\\\"undefined\\\"}]\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2019-07-11 14:17:32\"\n    },\n    \"hestia-pro::hestia_testimonials_content\": {\n        \"value\": \"[{\\\"text\\\":\\\"Felling amazing here with swimming pool. Bathroom Facility Changing Room Facility And Much more I experienced swimming pool here, water quality is so good very clean. Kids have separate pool and adults have separate pool.&lt;br &#x2F;&gt;\\\",\\\"link\\\":\\\"\\\",\\\"text2\\\":\\\"undefined\\\",\\\"image_url\\\":\\\"https://lh3.googleusercontent.com/-WlJzrTLTcYg/AAAAAAAAAAI/AAAAAAAAAAA/4T9RjZnXU_c/s50-c/photo.jpg\\\",\\\"title\\\":\\\"Mehul Maharaj\\\",\\\"subtitle\\\":\\\"\\\",\\\"social_repeater\\\":\\\"undefined\\\",\\\"id\\\":\\\"customizer_repeater_56d7ea7f40d56\\\",\\\"shortcode\\\":\\\"undefined\\\"},{\\\"text\\\":\\\"Best place for weekends with families. resort have many amenities including indoor Gymnasium, Swimming Pool and Party Plot. Resort Have Friendly Staff and Serves Traditional Cuisine along With Many Type Of Other Foods. I had Good Time Here And I Recommend It To Everyone.\\\",\\\"link\\\":\\\"\\\",\\\"text2\\\":\\\"undefined\\\",\\\"image_url\\\":\\\"https://lh3.googleusercontent.com/-LErw4MFR7M0/AAAAAAAAAAI/AAAAAAAAAAA/jBTfZ0yozo4/s50-c/photo.jpg\\\",\\\"title\\\":\\\"Laxit Patel\\\",\\\"subtitle\\\":\\\"\\\",\\\"social_repeater\\\":\\\"undefined\\\",\\\"id\\\":\\\"customizer_repeater_56d7ea7f40d66\\\",\\\"shortcode\\\":\\\"undefined\\\"},{\\\"text\\\":\\\"Nice place in a natural setting. Humble staff and helpful people. Nice big clean bathroom. Spent one night here. Food is simple and light on the stomach. They could clean up the surroundings more thoroughly to keep dust awa