ndefined\\\",\\\"id\\\":\\\"customizer_repeater_56d7ea7f40d56\\\",\\\"shortcode\\\":\\\"undefined\\\"},{\\\"text\\\":\\\"Best place for weekends with families. resort have many amenities including indoor Gymnasium, Swimming Pool and Party Plot. Resort Have Friendly Staff and Serves Traditional Cuisine along With Many Type Of Other Foods. I had Good Time Here And I Recommend It To Everyone.\\\",\\\"link\\\":\\\"\\\",\\\"text2\\\":\\\"undefined\\\",\\\"image_url\\\":\\\"https://lh3.googleusercontent.com/-LErw4MFR7M0/AAAAAAAAAAI/AAAAAAAAAAA/jBTfZ0yozo4/s50-c/photo.jpg\\\",\\\"title\\\":\\\"Laxit Patel\\\",\\\"subtitle\\\":\\\"\\\",\\\"social_repeater\\\":\\\"undefined\\\",\\\"id\\\":\\\"customizer_repeater_56d7ea7f40d66\\\",\\\"shortcode\\\":\\\"undefined\\\"},{\\\"text\\\":\\\"Nice place in a natural setting. Humble staff and helpful people. Nice big clean bathroom. Spent one night here. Food is simple and light on the stomach. They could clean up the surroundings more thoroughly to keep dust away.\\\",\\\"link\\\":\\\"\\\",\\\"text2\\\":\\\"undefined\\\",\\\"image_url\\\":\\\"https://lh3.googleusercontent.com/-w6SXQCnisA8/AAAAAAAAAAI/AAAAAAAADz0/SIanoyk7xQ4/s50-c-cc-mo/photo.jpg\\\",\\\"title\\\":\\\"Harshal Patel\\\",\\\"subtitle\\\":\\\"\\\",\\\"social_repeater\\\":\\\"undefined\\\",\\\"id\\\":\\\"customizer_repeater_56d7ea7f40d76\\\",\\\"shortcode\\\":\\\"undefined\\\"}]\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2019-07-11 13:12:44\"\n    },\n    \"hestia-pro::hestia_clients_bar_content\": {\n        \"value\": \"[{\\\"text\\\":\\\"undefined\\\",\\\"link\\\":\\\"https://www.justdial.com/Bhuj/Resort-Farmvilla-Opposite-Bhudiya-Farm-Near-Shreeji-Petrol-Pump-Odi/9999P2832-2832-180105131531-W6Q7_BZDET\\\",\\\"text2\\\":\\\"undefined\\\",\\\"image_url\\\":\\\"http://www.resortfarmvilla.com/wp-content/uploads/2019/07/Webp.net-resizeimage-5.png\\\",\\\"title\\\":\\\"undefined\\\",\\\"subtitle\\\":\\\"undefined\\\",\\\"