\n    },\n    \"hestia-pro::hestia_testimonials_content\": {\n        \"value\": \"[{\\\"text\\\":\\\"Felling amazing here with swimming pool. Bathroom Facility Changing Room Facility And Much more I experienced swimming pool here, water quality is so good very clean. Kids have separate pool and adults have separate pool.&lt;br &#x2F;&gt;\\\",\\\"link\\\":\\\"\\\",\\\"text2\\\":\\\"undefined\\\",\\\"image_url\\\":\\\"https://lh3.googleusercontent.com/-WlJzrTLTcYg/AAAAAAAAAAI/AAAAAAAAAAA/4T9RjZnXU_c/s50-c/photo.jpg\\\",\\\"title\\\":\\\"Mehul Maharaj\\\",\\\"subtitle\\\":\\\"\\\",\\\"social_repeater\\\":\\\"undefined\\\",\\\"id\\\":\\\"customizer_repeater_56d7ea7f40d56\\\",\\\"shortcode\\\":\\\"undefined\\\"},{\\\"text\\\":\\\"Best place for weekends with families. resort have many amenities including indoor Gymnasium, Swimming Pool and Party Plot. Resort Have Friendly Staff and Serves Traditional Cuisine along With Many Type Of Other Foods. I had Good Time Here And I Recommend It To Everyone.\\\",\\\"link\\\":\\\"\\\",\\\"text2\\\":\\\"undefined\\\",\\\"image_url\\\":\\\"https://lh3.googleusercontent.com/-LErw4MFR7M0/AAAAAAAAAAI/AAAAAAAAAAA/jBTfZ0yozo4/s50-c/photo.jpg\\\",\\\"title\\\":\\\"Laxit Patel\\\",\\\"subtitle\\\":\\\"\\\",\\\"social_repeater\\\":\\\"undefined\\\",\\\"id\\\":\\\"customizer_repeater_56d7ea7f40d66\\\",\\\"shortcode\\\":\\\"undefined\\\"},{\\\"text\\\":\\\"Nice place in a natural setting. Humble staff and helpful people. Nice big clean bathroom. Spent one night here. Food is simple and light on the stomach. They could clean up the surroundings more thoroughly to keep dust away.\\\",\\\"link\\\":\\\"\\\",\\\"text2\\\":\\\"undefined\\\",\\\"image_url\\\":\\\"https://lh3.googleusercontent.com/-w6SXQCnisA8/AAAAAAAAAAI/AAAAAAAADz0/SIanoyk7xQ4/s50-c-cc-mo/photo.jpg\\\",\\\"title\\\":\\\"Harshal Patel\\\",\\\"subtitle\\\":\\\"\\\",\\\"social_repeater\\\":\\\"undefined\\\",\\\"id\\\":\\\"customizer_repeater_56d7ea7f40d76\\\",\\\"shortcode\\\":\\\"undefined\\\"}]\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2019-07-13 05:29:54\"\n    },\n    \"hestia-pro::hestia_clients_bar_content\": {\n        \"value\": \"[{\\\"text\\\":\\\"undefined\\\",\\\"link\\\":\\\"https://www.justdial.com/Bhuj/Resort-Farmvilla-Opposite-Bhudiya-Farm-Near-Shreeji-Petrol-Pump-Odi/9999P2832-2832-180105131531-W6Q7_BZDET\\\",\\\"text2\\\":\\\"undefined\\\",\\\"image_url\\\":\\\"http://resortfarmvilla.com/wp-content/uploads/2019/07/Webp.net-resizeimage-5.png\\\",\\\"title\\\":\\\"undefined\\\",\\\"subtitle\\\":\\\"undefined\\\",\\\"social_repeater\\\":\\\"undefined\\\",\\\"id\\\":\\\"customizer-repeater-5d2700478ef90\\\",\\\"shortcode\\\":\\\"undefined\\\"},{\\\"text\\\":\\\"undefined\\\",\\\"link\\\":\\\"https://www.booking.com/hotel/in/resort-farm-villa.html\\\",\\\"text2\\\":\\\"undefined\\\",\\\"image_url\\\":\\\"http://resortfarmvilla.com/wp-content/uploads/2019/07/Webp.net-resizeimage-3.png\\\",\\\"title\\\":\\\"undefined\\\",\\\"subtitle\\\":\\\"undefined\\\",\\\"social_repeater\\\":\\\"undefined\\\",\\\"id\\\":\\\"customizer-repeater-5d26fe73bd4a9\\\",\\\"shortcode\\\":\\\"undefined\\\"},{\\\"text\\\":\\\"undefined\\\",\\\"link\\\":\\\"https://www.goibibo.com/hotels/oyo-28471-resort-farm-vila-hotel-in-bhuj-3808251881716652165/?hquery=%7B%22ci%22%3A%2220190714%22%2C%22co%22%3A%2220190715%22%2C%22r%22%3A%221-2-0%22%2C%22ibp%22%3A%22v3%22%2C%22ts%22%3A1%2C%22fwdp%22%3A%7B%22hn%22%3A%22oyo%2028471%20resort%20farm%20vila%22%7D%2C%22pricedet%22%3A%22mp-1785-3504-5289%22%7D&galist=D_H_D_F_%3C%3E&npvp=2380&at=h\\\",\\\"text2\\\":\\\"undefined\\\",\\\"image_url\\\":\\\"http://resortfarmvilla.com/wp-content/uploads/2019/07/Webp.net-resizeimage-9.png\\\",\\\"title\\\":\\\"undefined\\\",\\\"subtitle\\\":\\\"undefined\\\",\\\"social_repeater\\\":\\\"undefined\\\",\\\"id\\\":\\\"customizer-repeater-5d26fea32b028\\\",\\\"shortcode\\\":\\\"undefined\\\"},{\\\"text\\\":\\\"undefined\\\",\\\"link\\\":\\\