,'',0),(265,1,'2019-07-15 07:33:16','2019-07-15 07:33:16','<a href=\"\">Occupancy</a>\n									<a href=\"\">Rules</a>\n									<a href=\"\">Policies</a>\n									Occupancy\n					<ul>\n<li>In Resort All Rooms 02 + 02 persons are allowed in all rooms.</li>\n<li>Pets are allowed.</li>\n<li>Only 1 Child in room below 5 years can stay complimentary with the parents, More than 1 children below 5 years will be counted as extra occupancy, Above 5 years will be counted as an Extra Person.</li>\n</ul>\n									Rules\n					<ul>\n<li>We reserve the rights to change the tariffs without any prior notifications.</li>\n<li>Every guest is required to carry their Photo Identity with them.</li>\n<li>Smoking is not allowed inside resort.</li>\n</ul>\n									Policies\n					<ul>\n<li>30% of total amount will be deducted if canceled before 30 days of scheduled arrival. Full amount will be refunded if canceled before 40days of scheduled arrival only nominal charges will be deducted.</li>\n<li>50% of total amount will be deducted if canceled before 15 days(but less than 30 Days) of scheduled arrival.</li>\n<li>¬†Refund, if canceled during less than 15 days of scheduled arrival.</li>\n<li>After Check-in, if any cancellation for same day or next day, guests has to pay full amount as per the current tariff.</li>\n<li>No refund will be provided on booking of extra beds, if Cancelled individually.</li>\n<li>Changes in dates, guest name, or category of rooms would be treated as cancellation.</li>\n</ul>\n<p></p>\n			Strictly Prohibited\n							Gujarat is a \'dry state\' by law when it comes to alcoholic drinks are not allowed.\n It is therefore illegal to carry, purchase or consume alcohol in the entire Gujarat state. \nAlcohol is strictly prohibited within the premises has rights, not to allow any guest whom is drunk is not responsible,\n if any guest is caught in drunken condition by the local police.','Terms & Policies','','publish','closed','closed','','terms','','','2019-07-15 07:47:56